        <div className='container'>
            <div className='layout row'>
                <div className='col-xxl'>
                    <Sidebar />
                </div>
                <div className='col-xxl'>
                    <Content />
                </div>
                <div className='col-xxl'>
                    <Description />
                </div>
            </div>
        </div>
    )
}

export default index
